import React, { useState } from 'react';
import axios from 'axios';

const ProposalForm = () => {
  const [formData, setFormData] = useState({
    clientInfo: ['', '', '', '', ''],
    projectDetails: ['', '', ''],
    hourlyRate: '',
  });
  const [generatePDF, setGeneratePDF] = useState(false);
  const [proposal, setProposal] = useState('');

  const handleChange = (e) => {
    const { name, value, dataset } = e.target;
    if (dataset.group) {
      setFormData((prevData) => {
        const group = prevData[dataset.group];
        group[dataset.index] = value;
        return { ...prevData, [dataset.group]: group };
      });
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log('Form data submitted:', formData);
    try {
      const response = await axios.post('/api/generate/proposal', { ...formData, generatePDF });
      console.log('Response from backend:', response.data);
      if (generatePDF) {
        const url = window.URL.createObjectURL(new Blob([response.data], { type: 'application/pdf' }));
        const link = document.createElement('a');
        link.href = url;
        link.setAttribute('download', 'proposal.pdf');
        document.body.appendChild(link);
        link.click();
        link.parentNode.removeChild(link);
      } else {
        setProposal(response.data.proposal);
      }
    } catch (error) {
      console.error('Error generating proposal:', error);
      alert(`Failed to generate proposal: ${error.response?.data?.details || error.message}`);
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <h2>Client Information</h2>
        <label>
          What is the name of the client?
          <input
            type="text"
            name="clientName"
            data-group="clientInfo"
            data-index="0"
            value={formData.clientInfo[0]}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          What is the client's industry?
          <input
            type="text"
            name="clientIndustry"
            data-group="clientInfo"
            data-index="1"
            value={formData.clientInfo[1]}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          What is the size of the client's company (e.g., small, medium, large)?
          <input
            type="text"
            name="clientSize"
            data-group="clientInfo"
            data-index="2"
            value={formData.clientInfo[2]}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          What is the client's contact information (email, phone number)?
          <input
            type="text"
            name="clientContact"
            data-group="clientInfo"
            data-index="3"
            value={formData.clientInfo[3]}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Who is the primary contact person for the project?
          <input
            type="text"
            name="primaryContact"
            data-group="clientInfo"
            data-index="4"
            value={formData.clientInfo[4]}
            onChange={handleChange}
          />
        </label>
        <br />
        <h2>Project Details</h2>
        <label>
          What is the primary goal of this project?
          <input
            type="text"
            name="projectGoal"
            data-group="projectDetails"
            data-index="0"
            value={formData.projectDetails[0]}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          What specific problems or needs does this project aim to address?
          <input
            type="text"
            name="projectProblems"
            data-group="projectDetails"
            data-index="1"
            value={formData.projectDetails[1]}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Why is this project important for the client?
          <input
            type="text"
            name="projectImportance"
            data-group="projectDetails"
            data-index="2"
            value={formData.projectDetails[2]}
            onChange={handleChange}
          />
        </label>
        <br />
        <h2>Pricing and Costs</h2>
        <label>
          What is the predefined hourly rate for this project in NOK?
          <input
            type="number"
            name="hourlyRate"
            value={formData.hourlyRate}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Generate PDF:
          <input
            type="checkbox"
            checked={generatePDF}
            onChange={(e) => setGeneratePDF(e.target.checked)}
          />
        </label>
        <br />
        <button type="submit">Generate Proposal</button>
      </form>
      {proposal && (
        <div>
          <h2>Generated Proposal</h2>
          <div dangerouslySetInnerHTML={{ __html: proposal.replace(/\n/g, '<br />') }} />
        </div>
      )}
    </div>
  );
};

export default ProposalForm;
